import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowseRouter, Route} from 'react-router-dom';
import Wordcloud from './wordcloud';


function App() {
  return (
    <div className="Inmotion">
        <BrowseRouter> 
            <Route path="/wordcloud/" component={wordcloud}/>
        </BrowseRouter>
    </div>
  );
}

export default App;
